INSERT INTO `lesson_answers` (`id`, `user_id`, `lesson_question_id`, `answer_text`, `submitted_at`) VALUES (8,15,16,'A VA Streamline Refinance, or Interest Rate Reduction Refinance Loan (IRRRL), is a VA-backed refinance option that allows eligible homeowners to lower their mortgage interest rate by applying for a new VA home loan','2025-10-02 22:59:54'),(9,15,17,'It is three are the type of mortgage \r\n conventional mortgage  = A loan not insured or guaranteed by the gov.\r\nVA mortgage = A government backed loan for veterans active duty military and some spouses \r\nFHA mortgage =A government insured loan design for first time buyers or those with lower FICO','2025-10-02 22:59:54'),(10,15,18,'PMI determine if its a FHA','2025-10-02 22:59:54'),(11,15,19,'HELOC is a revolving secured loan like a credit card that uses your home equity as collateral  \r\nlate payments can be define as any payment after the due date','2025-10-02 22:59:54'),(12,15,20,'A debt-to-income (DTI) ratio is a percentage that compares your total monthly debt payments to your gross monthly income to assess your financial health and ability to repay loans.','2025-10-02 22:59:54'),(13,7,25,'Loan Amount is the total money we originally borrow from the bank or lender when you get our mortgage or home loan.\r\nMortgage Balance is how much money you still owe on that loan after making some payments over time.','2025-10-02 23:00:04'),(14,7,26,'When you do a cash-out refinance, you replace your old mortgage with a new one that is bigger than what you owe right now. \r\nThe new loan pays off your old mortgage balance first, and then the remaining extra amount is given to you in cash.','2025-10-02 23:00:04'),(15,7,27,'580+','2025-10-02 23:00:04'),(16,7,28,'Property Value is what your home is worth in the current market basically, the price someone would pay for it if you sold it today.\r\n\r\nHome Equity is the part of the home  truly own It\'s calculated by taking the property value and subtracting what we still owe on your mortgage (and any other loans on the home). So, Equity = Property Value âˆ’ Mortgage Balance.','2025-10-02 23:00:04'),(17,7,29,'Fixed-rate mortgage means the interest rate and monthly payment stay the same for the whole loan, so it\'s easy to plan and budget. \r\nAn adjustable-rate mortgage  starts with a lower rate that can change over time, making payments go up or down based on market rates.','2025-10-02 23:00:04'),(18,14,25,'Mortgage balance is the amount that customer still owe on the home loan and loan amount is that amount we give to customer means mortgage balance plus cash out amount','2025-10-02 23:35:25'),(19,14,26,'Current mortgage balance is the amount that customer still owe on the home loan and new loan amount after taking a cash out is a that process that we called Cash out refinance.','2025-10-02 23:35:25'),(20,14,27,'580+','2025-10-02 23:35:25'),(21,6,25,'Mortgage balance is the remaining amount owed after payments and interest of your initial loan amount VS. loan amount is the total money initially borrowed.','2025-10-02 23:03:25'),(22,6,26,'Current mortgage amount is you currently owe on your existing mortgage and New loan amount is the total principal of the new loan/mortgage you are taking out.  Basically the new loan amount is a total of mortgage balance + cash out = new loan amount.','2025-10-02 23:03:25'),(23,6,27,'580+','2025-10-02 23:03:25'),(24,6,28,'Home property value is the total current market price of your home.  Home equity is the portion of the home value that you actually own.  we calculate equity like Mortgage balance - Property value = Equity. we do 90% of equity in cash out if cx qualify.','2025-10-02 23:03:25'),(25,6,29,'A fixed-rate loan interest rate is set for the entire term VS adjustable-rate loan interest rate can fluctuate over time based on market conditions.','2025-10-02 23:03:25'),(26,15,25,'The Mortgage Balance is the remaining principal amount owed on the mortgage at any given time . loan amount can be define as sum of mortgage balance and cash out amount  .','2025-10-02 23:12:42'),(27,15,26,'the current mortgage balance is the  remaining principal amount owed on the mortgage and the new amount after  sum of mortgage balance and cash out amount  .','2025-10-02 23:12:42'),(28,15,27,'the best FICO score to get the best interest rate it must b/w 580 to 800','2025-10-02 23:12:42'),(29,15,28,'Home equity is the current market value of your property minus any outstanding mortgage  representing the portion of the home you truly own. Property value is simply the home\'s total worth on the market.','2025-10-02 23:12:42'),(30,15,29,'fixed rates are the interest rate  remain same its total time of the loan . \r\nadjustable rates the interest rate adjustable in the time of loan','2025-10-02 23:12:42'),(31,8,25,'Mortgage balance is the total amount of money you still owe on your home loan.\r\nLoan amount is the total sum of money that a lenders provides to the borrower.\r\nLoan amount= [Mortgage  balance+ Cash out amount]','2025-10-02 23:14:07'),(32,8,26,'The current mortgage balance is what you still owe on your original home loan, while the new loan amount is the total amount of the new, larger mortgage you receive after a cash-out refinance.','2025-10-02 23:14:07'),(33,8,27,'The best FICO score to get the best interest rate is 580 or above.','2025-10-02 23:14:07'),(34,8,28,'Home\'s property value:- The home\'s total worth on the current market. It is determined by factors like comparable sales in your neighbourhood and the home\'s features.\r\nHome\'s equity:- Your ownership stake in the home, calculated as the property\'s current market value minus your outstanding mortgage balance and any other loans secured by the property.\r\n[Equity= Home current value - Mortgage balance]','2025-10-02 23:14:07'),(35,8,29,'Fixed Rates:- A fixed-rate mortgage has an interest rate that remains the same for the entire life of the loan. That means your principal and interest payments will not change.\r\n\r\nAdjustable Rates:- An adjustable-rate mortgage is a home loan with an interest rate that changes after an initial fixed period.','2025-10-02 23:14:07'),(36,6,16,'A type of mortgage product that allows Veterans with an existing VA loan to refinance it with to lower their interest rate, potentially reducing their monthly payments, or convert an adjustable-rate loan to a fixed-rate one.','2025-10-02 23:32:02'),(37,6,18,'Conventional loan is a not insured or guaranteed by the government. Usually requires a good credit score and a down payment (often 5%â€“20%). Common for buyers with stable finances. \r\nFHA loan is a government-insured loan designed for first-time buyers or those with lower credit scores. Requires a smaller down payment (as low as 3.5%) but includes mortgage insurance premiums.','2025-10-02 23:32:02'),(38,6,20,'DTI ratio is a financial measure that compares your monthly debt payments to your monthly gross income.\r\n We can Calculated as (Total monthly mortgage payments Ã· Gross monthly income) Ã— 100','2025-10-02 23:32:02'),(42,13,25,'Mortgage balance is the amount of money you still owe on your home loan. \r\nMortgage Balance = What you borrow - what you have already paid back. \r\nloan amount is the addition of mortgage balance and cash out amount that our customer want according to his requirement . \r\nLoan Amount = mortgage balance + cash out amount','2025-10-02 23:19:36'),(43,13,26,'Current mortgage balance is the remaining amount of principal that a borrower owes . \r\nThe new loan amount will be the sum of the existing mortgage balance and the cash taken out','2025-10-02 23:19:36'),(44,13,27,'The best fico score to get the best interest rate for VA LOAN that is must be more than 580 . \r\nHigher FICO SCORE equals to best credit .','2025-10-02 23:19:36'),(45,13,28,'Equity is the portion of your home value that you actually own outright . \r\nEQUITY = Home current market value - mortgage balance \r\nHome\'s property value is the actual market value of our home .','2025-10-02 23:19:36'),(46,13,29,'fixed rates remain the same throughout the period of the mortgage . \r\nAdjustable rates can change after an initial fixed period .','2025-10-02 23:19:36'),(52,15,21,'Cash-out refers to receiving cash from a refinance while increasing the total loan amount and lower rate refers to securing a lower interest rate on an existing loan','2025-10-02 23:32:28'),(53,15,22,'Cash-out refers to receiving cash from  refinance while increasing the total loan amount and lower rate refers to securing a lower interest rate on an existing loan','2025-10-02 23:32:28'),(54,15,23,'often around six  months,','2025-10-02 23:32:28'),(55,15,24,'This involves combining multiple debts, such as high-interest credit card balances and personal loans, into a single, new loan. \r\nInvestment is the act of allocating money or other resources into an asset with the expectation of generating a future return, either through income','2025-10-02 23:32:28'),(56,9,25,'Mortgage Balance: Mortgage balance is the amount that is left to be paid to the lender. Example: Initially $200,000 mortgage was taken from Bank A and the customer has paid $50,000 to the Bank A, then the remaining $150,000 is the Mortgage Balance.\r\nLoan Amount: It is the summation of Mortgage Balance and cash-out amount. Example: if Mortgage Balance is $150,000 and cash-out amount is $50,000, then the Loan Amount is $200,000.','2025-10-02 23:23:57'),(57,9,26,'Current Mortgage Balance: It is the amount you still owe to the lender.\r\nNew Loan Amount: It is the summation of Mortgage Balance and cash-out amount. Example: if Mortgage Balance is $150,000 and cash-out amount is $50,000, then the Loan Amount is $200,000.','2025-10-02 23:23:57'),(58,9,27,'The best FICO score to get the best interest rate should be above 620.','2025-10-02 23:23:57'),(59,9,28,'EQUITY: It is the difference between the Property value and Mortgage Balance.\r\nHome\'s Property Value: It is the actual market value of the property.\r\nCash-Out refinance directly depends on the home\'s equity. we can only give cash out upto 90% of the home\'s equity.','2025-10-02 23:23:57'),(60,9,29,'Fixed Rates: These types of interest rates are fixed throughout the loan tenure.\r\nAdjustable Rates: These types of interest rates are changeable after a fixed amount of time.','2025-10-02 23:23:57'),(62,6,17,'Conventional is a type of loan not insured or guaranteed by the government. Usually requires a good credit score and a down payment (often 5%â€“20%). Common for buyers with stable finances.\r\nFHA is a type of loan government-insured loan designed for first-time buyers or those with lower credit scores. Requires a smaller down payment (as low as 3.5%) but includes mortgage insurance premiums.','2025-10-02 23:32:02'),(64,6,19,'HELOC is a loan using your homeâ€™s equity as collateral. \r\nCASH - OUT A type of refinancing where you take a new loan for more than you owe on your home and receive the extra amount in cash. \r\nLate payment When you donâ€™t pay your loan or bill by the due date. \r\nForbearance is temporary pause or reduction in your loan payments.','2025-10-02 23:32:02'),(70,6,21,'Cash out is a type of refinancing where you take a new loan for more than you owe on your home.\r\nLower is a term for lower interest rate than your current mortgage interest rate.','2025-10-02 23:31:44'),(71,6,22,'Cash out is a type of refinancing where you take a new loan for more than you owe on your home.\r\nLower is a term for lower interest rate than your current mortgage interest rate.','2025-10-02 23:31:44'),(72,6,23,'Last should be 1 yr. and if 6 mortgage monthly payment is done then cx qualify.','2025-10-02 23:31:44'),(73,6,24,'Debt consolidation is the process of combining multiple debts into a single loan.\r\nInvestment is the act of committing money or capital to an asset.','2025-10-02 23:31:44'),(90,14,28,'Home equity is the portion of your home you own outright (property value- Mortgage balance ), while property value is the home\'s current market worth. A cash-out refinance uses this equity by replacing your existing mortgage with a larger, new mortgage, which pays off the old loan and gives you the remaining amount','2025-10-02 23:35:25'),(91,14,29,'it is a type of Mortgage in which two option are available 1. fixed rate mean you need to pay fix amount in interest and 2.Adjustable rate (ARM) it can change after an initial fixed period','2025-10-02 23:35:25'),(92,7,16,'The IRRRL also known as the VA streamline refinance is a program offered by the US department of veterans affairs(VA)\r\nAllows veterans with an existing VA loan to refinance to a lower interest rate or switch from an adjustable to a fixed rate mortgage with minimal paper work.','2025-10-02 23:35:37'),(93,7,17,'A loan not insured or guaranted  by the government \r\nRequires good credit score and a down payment (often 5%- 20%) \r\nCommon for buyers with stable finances.\r\nFHA-\r\nA gov. insured designed for first time buyers or those with lower credit score.\r\nRequires a small down payment as low as 35% includes mortgage insurance premiums.','2025-10-02 23:35:37'),(94,7,18,'Premium mortgage  installment determine to FHA.','2025-10-02 23:35:37'),(95,7,19,'Cash out refinance - for more than we owe on our home and receive the extra amount in cash often we used for renovations, paying off debt, or big expenses.\r\nHeloc-  line of credit that allows a homeowner to borrow against their home\'s equity. \r\nLate Payment- a payment that fails to reach the recipient by the agreed-upon due date, resulting in penalties like fees, interest charges, and a damaged credit score.','2025-10-02 23:35:37'),(96,7,20,'Financial measure that compares your monthly debt payment to your monthly gross income.\r\nIt\'s used by lenders to assess how much of your income goes toward paying debts.','2025-10-02 23:35:37'),(97,8,16,'IRRRL stands for Interest rate of reduction refinance loan. VA streamline refinance program offered by US department for VA.','2025-10-02 23:38:08'),(98,8,17,'Conventional:- A conventional loan is a type of mortgage not insured or guaranteed by the government and these loans are available through private lenders like banks, credit unions, and mortgage companies.\r\n\r\nFHA- A FHA loan is a mortgage insured by the government .This government backing reduces risk for private lenders, allowing them to offer more favourable terms to borrowers who might not qualify for a conventional mortgage, particularly those with lower credit scores or smaller down payments. FHA loans are a popular option for first-time homebuyers.','2025-10-02 23:38:08'),(99,8,18,'PMI, stands for Private Mortgage Insurance and It is not used to determine if a loan is Conventional or FHA','2025-10-02 23:38:08'),(100,8,19,'HELOC- A home equity line of credit (HELOC) is a revolving line of credit that allows a homeowner to borrow against the equity. \r\nCash-out Refinance- A cash-out refinance is a type of mortgage refinancing where you replace your existing mortgage with a new, loan and receive the difference in cash at closing.\r\nLate Payments- when a customer don\'t pay your loan or bill by the due date it may lead to late fee and can hurt your credit score.\r\nForbearance- A temporary pause or reduction in your loan payment usually granted by the lenders.','2025-10-02 23:38:08'),(101,8,20,'A debt-to-income (DTI) ratio is a percentage that compares your total monthly debt payments to your gross monthly income to assess your financial health and ability to repay the loans.\r\n\r\nDTI= (Total monthly debts payments/Gross monthly income)* 100','2025-10-02 23:38:08'),(102,13,16,'IRRRL Stands for interest rate reduction refinance loan \r\nIt is also known as VA streamline refinance and is offered by U.S department of veteran affairs .','2025-10-02 23:42:14'),(103,13,17,'Conventional loan is a loan not insured by government . In this we need a good FICO Score and 5-20 % down payments . \r\nFHA Stands for federal housing administration loan \r\nIn this government insured loan decision for first time buyers or those who are with low credit scores .','2025-10-02 23:42:14'),(104,13,18,'PMI Stands for private mortgage instalments \r\nit is FHA','2025-10-02 23:42:14'),(105,13,19,'HELOC means we can say that we are having a one loan of 200,000 and we start another loan of 50,000 . \r\nCash out refinance is a type of refinance where you take a new loan for renovations , bills payments and debt consolidations . \r\nLate payments means when you don\'t pay your loan by the due date . \r\nForbearance means a temporary pause in your loan payments .','2025-10-02 23:42:14'),(106,13,20,'DTI Stands for debt to income ratio \r\nDTI = TOTAL MONTHLY DEBT PAYMENTS / GROSS MONTHLY INCOME *100','2025-10-02 23:42:14'),(107,8,21,'1- The difference between the new mortgage amount and the existing mortgage balance is taken out as cash. Homeowners might choose this option if they need funds for things like home improvements, debt consolidation, or other expenses.\r\n\r\n2-Lower rate refinance. This involves refinancing the current mortgage to secure a lower interest rate. The primary goal here is to reduce the monthly payments.','2025-10-02 23:44:18'),(108,8,22,'1- The difference between the new mortgage amount and the existing mortgage balance is taken out as cash. Homeowners might choose this option if they need funds for things like home improvements, debt consolidation, or other expenses.\r\n\r\n2-Lower rate refinance. This involves refinancing the current mortgage to secure a lower interest rate. The primary goal here is to reduce the monthly payments.','2025-10-02 23:44:18'),(109,8,23,'6 months','2025-10-02 23:44:18'),(110,8,24,'Debt consolidation is the process of combining multiple outstanding loans or debts into a single, new loan.\r\n\r\nInvesting is using money to buy assetsâ€”such as stocks, bonds, or mutual fundsâ€”with the expectation that they will grow in value over time, building wealth for the future.','2025-10-02 23:44:18'),(111,7,21,'To lower your monthly payments, reduce the total amount of interest paid over the life of the loan, or potentially shorten the loan term.To lower your monthly payments, reduce the total amount of interest paid over the life of the loan, or potentially shorten the loan term.To lower your monthly payments, reduce the total amount of interest paid over the life of the loan, or potentially shorten the loan term.','2025-10-02 23:44:26'),(112,7,22,'To lower your monthly payments, reduce the total amount of interest paid over the life of the loan, or potentially shorten the loan term.To lower your monthly payments, reduce the total amount of interest paid over the life of the loan, or potentially shorten the loan term.To lower your monthly payments, reduce the total amount of interest paid over the life of the loan, or potentially shorten the loan term.','2025-10-02 23:44:26'),(113,7,23,'6 months','2025-10-02 23:44:26'),(114,7,24,'Debt consolidation- To simplify debt repayment, lower monthly payments, and reduce the overall interest paid on multiple high-interest debts.\r\n\r\nInvestment- To grow wealth over time by generating returns from financial assets.','2025-10-02 23:44:26'),(115,14,16,'IRRRL is stands for Interest rate reduction refinance loan which is offered by the US Department of Veterans affair it allows veterans with an existing VA loan to refinance to a lower interest rate or switch from an adjustable to a fixed-rate mortgage.','2025-10-02 23:49:31'),(116,14,17,'A common loan not insured or guranteed by the government.Usually requires a good credit score and a down payment is called conventional loan and FHA loan stands for federal housing Administration loan a government insured loan designed for first time buyers with lower credit scores.','2025-10-02 23:49:31'),(117,14,18,'PMI is stands for private mortgage insurance and it is to determine if its Conventional loan.','2025-10-02 23:49:31'),(118,14,19,'A HELOC is a secondary mortgage, with its own independent payment schedule, that is secured by your home.  Cash out refinance is a new loan for more than you owe and receive the extra amount in cash. usally it is used for renovations of home and for major expenses. Although\"Late payments\" are missed or overdue loan or credit payments, while \"forbearance\" is a temporary pause or reduction in loan payments arranged with the lender.','2025-10-02 23:49:31'),(119,14,20,'it is the ratio or percentage we check the eligibility of customer total monthly debt by gross monthly income into 100.','2025-10-02 23:49:31'),(120,9,16,'VA Streamline Refinance which is also known as Interest Rate Reduction Refinance Loan is a program which is run by the U.S. Federation to provide the reduction in the interest rates of the Veteran Affairs (VA)','2025-10-02 23:49:40'),(121,9,17,'Conventional Mortgage: It is a type of Mortgage that is available for everyone but is not backed by the government. It requires quite high credit score and is best for the individuals with stable finances.\r\n\r\nFHA Mortgage: FHA stands for Federal Housing Association and it is a type of Mortgage that is only available for federal individuals and is backed by the government.','2025-10-02 23:49:40'),(122,9,18,'PMI stands for the Private Mortgage Insurance and it is used to determine if the mortgage is FHA type.','2025-10-02 23:49:40'),(123,9,19,'HELOC: HELOC stands for Home Equity Line Of Credit and it is a secured loan where your home acts as collateral.\r\nCASH-OUT Refinance: A cash-out refinance is a mortgage loan that allows homeowners to replace their existing mortgage with a new, larger loan, and receive the difference in cash.\r\n\r\nLate Payments: It simple means failure to pay the monthly payment by the agreed due date.\r\nForbearance: when someone want to pause the monthly payment of a loan for a time period then it is known as Forbearance.','2025-10-02 23:49:40'),(124,9,20,'DTI ratio or Debt-To-Income ratio is the ratio that is being used by the lenders to check if the investment is risky or not. It give an overview of how much percentage of the income is gone to pay debt.','2025-10-02 23:49:40'),(125,13,21,'cash out refers to taking cash out of an asset like a home\' equity during a refinance . \r\nLower rate refers to getting a reduced interest rate on a loan .','2025-10-02 23:52:55'),(126,13,22,'cash out refers to taking cash out of an asset like a home\' equity during a refinance . \r\nLower rate refers to getting a reduced interest rate on a loan .','2025-10-02 23:52:55'),(127,13,23,'6 Months','2025-10-02 23:52:55'),(128,13,24,'DEBT CONSOLIDATION means combining multiple debts into a single one . \r\nINVESTMENT is the act of allocating money into an asset or venture with the expectation of generating income or increasing its value .','2025-10-02 23:52:55'),(129,9,21,'Cash-Out: It means to get a amount after refinancing a current mortgage.\r\nLower rate: It simply means lower interest rates','2025-10-02 23:54:05'),(130,9,22,'Cash-Out: It means to get a amount after refinancing a current mortgage.\r\nLower rate: It simply means lower interest rates','2025-10-02 23:54:05'),(131,9,23,'The timeframe to refinance again is about 6 months.','2025-10-02 23:54:05'),(132,9,24,'Debt Consolidation: Debt consolidation is the process of combining multiple debts into a single loan or payment.','2025-10-02 23:54:05'),(133,14,21,'\"Cash-Out\" refers to taking cash out of an asset, like a home\'s equity during a refinance, while \"Lower Rate\" refers to getting a reduced interest rate on a loan.','2025-10-02 23:58:02'),(134,14,22,'\"Cash-Out\" refers to taking cash out of an asset, like a home\'s equity during a refinance, while \"Lower Rate\" refers to getting a reduced interest rate on a loan.','2025-10-02 23:58:02'),(135,14,23,'6 months','2025-10-02 23:58:02'),(136,14,24,'Debt consolidation is the act of combining multiple debts into a single, often lower-interest, loan to simplify repayment and reduce total costs. investment is  is the use of money to generate wealth over time by purchasing assets such as real estate.','2025-10-02 23:58:02'),(137,11,25,'mortgage balance is the remaining principal amount of a mortgage loan that a borrower still owes to the lender.\r\n\r\nloan amount to the total sum of money a borrower receives from a lender, also known as the principal amount, which is the foundation for calculating interest','2025-10-03 15:07:07'),(138,11,26,'current mortgage balance, check your latest mortgage statement or online account with your lender, as the balance changes with each payment.\r\n\r\n calculate your new loan amount after a cash-out refinance, you add the desired cash-out amount to your outstanding mortgage balance and any associated closing costs.','2025-10-03 15:07:07'),(139,11,27,'580 or more than above..','2025-10-03 15:07:07'),(140,11,28,'Home equity is your financial stake in the home, calculated as the property\'s current market value minus the remaining mortgage balance. Property value is the overall worth of the home itself, determined by its location, size, condition, and market conditions.\r\nYour home\'s equity is the market value of your home minus the outstanding balance on your current mortgage. A cash-out refinance essentially allows you to borrow against this equity, receiving the excess funds for personal expenses like debt consolidation or home improvements.','2025-10-03 15:07:07'),(141,11,29,'Fixed-rate loans have an interest rate that remains constant throughout the loan term, providing stable and predictable monthly payments. Adjustable-rate mortgages (ARMs) have an interest rate that can change periodically based on market fluctuations, meaning monthly payments can increase or decrease over time','2025-10-03 15:07:07');
